from typing import List

def maxArea(height: List[int]) -> int:
    max_volm = 0

    for start in range(1, len(height) + 1):
        for end in range(start + 1, len(height) + 1):
            # print(f"height[start - 1] = {height[start - 1]}")
            # print(f"height[end - 1] = {height[end - 1]}")

            max_volm = max(min(height[start - 1], height[end - 1]) * (end - start), max_volm)
            # print(
            #     f"max_volm = {max_volm} for start and end: {start - 1}, {end - 1} height[start-1], height[end-1]) {height[start - 1], height[end - 1]}")

    return max_volm



def threeSum( nums: List[int]) -> List[List[int]]:
    nums = sorted(nums)
    # print(nums)
    print(len(nums))
    result = []

    for i in range(len(nums)- 2):
        if i > 0 and nums[i] == nums[i-1]:
            continue
        left, right = i + 1, len(nums) - 1

        while left < right:
            current_sum = nums[i] + nums[left] + nums[right]
            if current_sum == 0:
                result.append([nums[i], nums[left], nums[right]])
                # Skip duplicates for second number

            elif current_sum < 0:
                left += 1
            else:
                right -= 1

    return result

def isHappy(n: int) -> bool:
    seen = set()

    while n != 1 and n not in seen:
        n_str = f"{n}"
        seen.add(n)
        n = 0
        print(seen)
        for char in n_str:
            n += int(char) ** 2

    return n == 1

print(isHappy(2))

